* Brand new Magpul MOE Mid Length Handguard in original box. Not used.
* Color: Flat Dark Earth (FDE).
* Mid Lenght Hanguard size 8 3/6.
I will only sell to Texas residents. Must be at least 21 years old and a citizen or Lawfully Admitted Permanent Resident (LAPR) of the U.S. 

PERSONS PROHIBITED BY FEDERAL LAW FROM POSSESSING FIREARMS

Persons convicted of a crime punishable by more than one year in prison;
Fugitives from justice;
Users of illegal drugs or persons addicted to illegal drugs;
Persons adjudicated mentally ill or incompetent and persons committed to a mental institution;
Persons dishonorably discharged from military;
Illegal aliens and nonimmigrant aliens;
Persons who have renounced US citizenship;
Persons under a qualifying order of protection; and,
Persons convicted of a misdemeanor crime of domestic violence.
NOTE: Persons under indictment for a felony are prohibited from receiving firearms and ammunition – they can continue to possess firearms and ammunition they have when the indictment is issued, but cannot receive any more firearms or ammunition.

